import styled from "styled-components";

const Div = styled.div`
    margin: 1.5rem ;
`

const Title = styled.h1`
    font-size: 1rem;
    font-weight: normal;
    text-align: center;
`

const count = [1, 2, 3, 4]


function MainSecIconsService() {
    return (
        <Div>
            {count.map(n => <img src={`./icon${n}`}></img>)} 
        </Div>
    )
}

export default MainSecIconsService
